import React, { Component } from "react";

class Okres extends React.Component{
    render(){      
    const divStyle = {
        width:'100px', 
        height:'100px', 
        backgroundColor:'black',
    };
        return(


            <div style={divStyle}></div>
        );
    }
}

export default Okres
